import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Button from './Button.js'

let eu = {
  nome: 'Nicolas',
  sobrenome: 'Silva'
}

class App extends Component {


  render() {
    return (
      <Button title = {eu.nome} content = {eu.sobrenome}/>
    );
  }
}

export default App;
